configure:
  commands:
    10 permit tcp any any eq telnet time-range time1: "10 permit tcp any any eq telnet\
      \ time-range time1\r\n"
    end:
      new_state: execute
    ip access-list extended TIME_BASED_ACL_permit: "ip access-list extended TIME_BASED_ACL_permit\r\
      \n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: stack3-nyq-PE1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyq-PE1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyq-PE1#
